function getIcon(state) {
    var iconclass = '';
    state = state.toLowerCase();
    if (state.indexOf('sunny')) {
        iconclass = 'icon-sun';
    } else if (state.indexOf('cloud')) {
        if (state.indexOf('partly')){
            iconclass = 'icon-partly-cloudy';
        }else{
            iconclass = 'icon-cloudy';
        }
    } else if (state.indexOf('rain')) {
        iconclass = 'icon-rain';
    } else {
        iconclass = 'icon-sun';
    }
    return iconclass;
}


function init() {
    var cWrapper = $('.canvas-wrapper');
    var canvas = $('#weekcanvas')[0];
    canvas.width = cWrapper[0].clientWidth;
    canvas.height = cWrapper[0].clientHeight;
    var currentData, weekData, hourData;
    if(localStorage.getItem('cityname')){
        $('.location').html(localStorage.getItem('cityname'));
    }
    if (localStorage.getItem('currentData')) {
        currentData = JSON.parse(localStorage.getItem('currentData'));
        weatherInfo.current = currentData;
        renderCurrent(currentData);
        renderMore(currentData);
    }
    if (localStorage.getItem('weekData')) {
        weekData = JSON.parse(localStorage.getItem('weekData'));
        callRenderToday(weekData);
        renderTomorrow(weekData);
        renderWeekTemp(weekData);
        renderWeekState(weekData);
    }
    if (localStorage.getItem('hourData')) {
        hourData = JSON.parse(localStorage.getItem('hourData'));
        renderHours(hourData);
    }
}


function renderCurrent(data) {
    var state = data.weather[0].main.toLowerCase();
    var iconEle = $('.dayinfo-wrapper.today .icon-wrapper .icon')[0];
    $('.dayinfo-wrapper.today .temp').text(data.main.temp + '°');
    $('.dayinfo-wrapper.today .state').text(data.weather[0].description.toLowerCase());
    $('.dayinfo-wrapper.today .date').text(changeAPIDate(data.dt, 1));
    fillDayInfoIcon(iconEle,state);

}


function callRenderToday(data){
    var data = data.list[0];
    var flag;
    setInterval(function(){
        flag = !flag;
        if(flag){
            renderToday(data,'Today');
        }else{
            renderToday(weatherInfo.current, 'Current');
        }
    }, 2000);
}


function renderToday(data, title) {
    //today的数据分为两个  一个是current(表示此时此刻的数据)  一个是今天 //他们json结构不同
    var state = data.weather[0].main.toLowerCase();
    var iconEle = $('.dayinfo-wrapper.today .icon-wrapper .icon')[0];
    if (!data.temp) {
        data.temp = {};
        data.temp.min = data.main.temp_min;
        data.temp.max = data.main.temp_max;
    }

    $('.dayinfo-wrapper.today .title span').text(title);
    if (title.toLowerCase() == 'today') {
        $('.dayinfo-wrapper.today .temp').text(data.temp.min + '°C - ' + data.temp.max + '°C');
    } else {
        $('.dayinfo-wrapper.today .temp').text(data.main.temp + '°C');
    }
    $('.dayinfo-wrapper.today .state').text(data.weather[0].description.toLowerCase());
    $('.dayinfo-wrapper.today .date').text(changeAPIDate(data.dt, 1));
    fillDayInfoIcon(iconEle,state);

}



function renderTomorrow(data){
    var data = data.list[1];
    var state = data.weather[0].main.toLowerCase();
    var iconEle = $('.dayinfo-wrapper.tomorrow .icon-wrapper .icon')[0];
    $('.dayinfo-wrapper.tomorrow .temp').text(data.temp.min + '°C - ' + data.temp.max + '°C');
    $('.dayinfo-wrapper.tomorrow .state').text(data.weather[0].description.toLowerCase());
    $('.dayinfo-wrapper.tomorrow .date').text(changeAPIDate(data.dt, 1));
    fillDayInfoIcon(iconEle,state);
}


//for today  current tomorrow  use icon png
function fillDayInfoIcon(iconEle, state){
    if (state.indexOf('sunny')) {
        iconEle.className = 'icon img-sun';

    } else if (state.indexOf('cloud')) {
        if (state.indexOf('partly')){
            iconEle.className = 'icon img-partly-cloudy';
        }else{
            iconEle.className = 'icon img-cloudy';
        }
    } else if (state.indexOf('rain')) {
        iconEle.className = 'icon img-rain';

    } else {
        iconEle.className = 'icon img-sun';
    }
}

function changeAPIDate(dt, day, dateParam, hour, min, AMPM){
    var date = new Date(dt*1000);
    var DAY = ['Mon', 'Tue', 'Wed', 'Thu', 'Fri', 'Sat', 'Sun'];
    if(day){
        return DAY[date.getDay()];
    }else if(dateParam){
        return (date.getMonth() +1)  + '.' + date.getDate();
    }else{
        rs = '';
        rs += getHour();
        if(min){
            rs += ':';
            rs += date.getMinutes() < 10 ? '0' + date.getMinutes() : date.getMinutes();
        }
        if(AMPM){
            rs += AMPMStr(date.getHours());
        }
        return rs;
    }
    function getHour(){
        if(AMPM && date.getHours() > 12){
            return date.getHours() - 12;
        }
        return date.getHours();
    }
    function addZero(v){
        return v<10 ? '0'+v : v ;
    }
    function AMPMStr(){
        return date.getHours()>12 ? 'PM': 'AM';
    }
}

function renderHours(data) {
    data.list = data.list.slice(0, 11);
    data.list.forEach(function(item) {
        item.time = changeAPIDate(item.dt,0,0,1,1,0);
        item.date = changeAPIDate(item.dt,0,1,0,0,0);
        item.iconClass = getIcon(item.weather[0].main);
        item.description = item.weather[0].main;
        item.temp  = item.main.temp + '°C';
    });
    var temp = $('#hours').html();
    var templateFun = _.template(temp);
    var html = templateFun(data);
    $tempDiv = $(html);
    $('.hour-wrapper.today').html($tempDiv);
}

function renderWeekTemp(weekData) {
    var weekEdgeValue = findMaxMin(weekData);
    var canvas = $('#weekcanvas')[0];
    var MAX = 0,
        MIN = 1;
    var weekMaxArr = getWeekMaxMin(weekData, MAX);
    var weekMinArr = getWeekMaxMin(weekData, MIN);
    draw(canvas, weekMinArr, weekMaxArr, weekEdgeValue.min, weekEdgeValue.max);

    function draw(canvas, weekMinArr, weekMaxArr, weekMin, weekMax) {
        var padding = 15*window.devicePixelRatio;
        var ctx = canvas.getContext('2d');
        var range = canvas.height - padding * 2;
        var topLine = padding;
        var bottomLine = canvas.height;
        var unit = range / (weekMax - weekMin);
        var topPoint = 0 + padding;
        var colCount = 7; //列数
        var xSeries, yMaxSeries, yMinSeries; //横坐标和两个纵坐标数组
        xSeries = (function() {
            var colWidth = canvas.width / colCount;
            var xSer = [];
            for (var i = 0; i < colCount; i++) {
                xSer.push(i * colWidth + colWidth / 2);
            }
            return xSer;
        })();
        yMaxSeries = (function() {
            var yMaxPoint = [];
            weekMaxArr.forEach(function(dayMax) {
                yMaxPoint.push((weekMax - dayMax) * unit + topPoint);
            });
            return yMaxPoint;
        })();
        yMinSeries = (function() {
            var yMinPoint = [];
            weekMinArr.forEach(function(dayMin) {
                yMinPoint.push((weekMax - dayMin) * unit + topPoint)
                console.log('yMin' + yMinPoint);
            });
            return yMinPoint;
        })();
        //一周高低温=============================================
        fillWeekTemperature();
        function fillWeekTemperature(){
            var fragmentMin = document.createDocumentFragment();
            var fragmentMax = document.createDocumentFragment();
            var i =0;
            weekMinArr.forEach(function(item){
                var div = document.createElement('div');
                div.classList.add('daytemp');
                div.innerHTML = '<div class="text">' + item + '</div>';
                fragmentMin.appendChild(div);
            });
            weekMaxArr.forEach(function(item){
                var div = document.createElement('div');
                div.classList.add('daytemp');
                div.innerHTML =  '<div class="text">' + item + '</div>';
                fragmentMax.appendChild(div);
            });
            $('.week-state-wrapper-high').empty();
            $('.week-state-wrapper-low').empty();
            $('.week-state-wrapper-high').append(fragmentMax);
            $('.week-state-wrapper-low').append(fragmentMin);
        }

        //开始Canvas的折线 =====================================
        ctx.clearRect(0, 0, canvas.width, canvas.height);
        ctx.fillStyle = '#666';
        yMaxSeries.reduce(function(prey, cury, i) {
            ctx.beginPath();
            ctx.moveTo(xSeries[i - 1], prey);
            ctx.lineTo(xSeries[i], cury);
            ctx.lineTo(xSeries[i],bottomLine);
            ctx.lineTo(xSeries[i - 1],bottomLine);
            ctx.closePath();
            ctx.fill();
            // ctx.stroke();
            //不光是有折线 还要用颜色填充区域
            return cury; //作为下一次的prey
        });
        ctx.fillStyle = '#444';
        yMinSeries.reduce(function(prey, cury, i) {
            ctx.beginPath();
            ctx.moveTo(xSeries[i - 1], prey);
            ctx.lineTo(xSeries[i], cury);
            ctx.lineTo(xSeries[i],bottomLine);
            ctx.lineTo(xSeries[i - 1],bottomLine);
            ctx.fill();
            // ctx.stroke();
            return cury;
        });
        //canvas画点
        var radius = 3;
        yMaxSeries.forEach(function(item,i){
            ctx.beginPath();
            ctx.arc(xSeries[i], item, radius, 0, 2 * Math.PI, false);
            ctx.fillStyle = '#fff';
            ctx.fill();
        });
        yMinSeries.forEach(function(item, i){
            ctx.beginPath();
            ctx.arc(xSeries[i], item, radius, 0, 2 * Math.PI, false);
            ctx.fillStyle = '#fff';
            ctx.fill();
        });
    }

    function findMaxMin(data) {
        var min, max;
        min = data.list[0].temp.min;
        max = data.list[0].temp.max;
        data.list.forEach(function(day) {
            if (+day.temp.min < min) {
                min = day.temp.min;
            }
            if (+day.temp.max > max) {
                max = day.temp.max;
            }
        });
        return {
            min: min,
            max: max
        }
    }

    function getWeekMaxMin(data, type) {
        var arr = [];
        data.list.forEach(function(day) {
            if (type == MAX) {
                arr.push(day.temp.max);
            } else {
                arr.push(day.temp.min);
            }
        });
        return arr;
    }
}

function renderWeekState(weekData) {
    var oFragState = document.createDocumentFragment();
    var oFragDay = document.createDocumentFragment();
    var oFragDate = document.createDocumentFragment();
    var DAY = ['Mon', 'Tue', 'Wed', 'Thu', 'Fri', 'Sat', 'Sun'];
    weekData.list.forEach(function(day) {
        var divState = document.createElement('div');
        var divDay = document.createElement('div');
        var divDate = document.createElement('div');
        var time = new Date(day.dt * 1000);
        divState.className = 'day-state';
        // divState.innerText = day.weather[0].main;
        divState.classList.add(getIcon(day.weather[0].main));
        oFragState.appendChild(divState);
        divDay.className = 'day-day';
        divDay.innerText = DAY[time.getDay()];
        oFragDay.appendChild(divDay);
        divDate.className = 'day-date';
        divDate.innerText = (time.getMonth()+1) + '.' + time.getDate();
        oFragDate.appendChild(divDate);
    });
    $('.day-state-wrapper').empty();
    $('.day-state-wrapper').append(oFragState);
    $('.day-day-wrapper').empty();
    $('.day-day-wrapper').append(oFragDay);
    $('.day-date-wrapper').empty();
    $('.day-date-wrapper').append(oFragDate);
}

function renderMore(data) {
    data.list = [];
    data.list.push({
        infoKey: 'Sunrise:',
        infoValue: changeAPIDate(data.sys.sunrise, 0,0,1,1,1)
    }, {
        infoKey: 'Sunset:',
        infoValue: changeAPIDate(data.sys.sunset, 0,0,1,1,1)
    }, {
        infoKey: 'Wind Speed:',
        infoValue: data.wind.speed
    }, {
        infoKey: 'Humidity:',
        infoValue: data.main.humidity
    }, {
        infoKey: 'Pressure:',
        infoValue: data.main.pressure
    });
    var templateFun = _.template($('#moreInfo').html());
    $('.more-info-wrapper').html(templateFun(data));
}

function formatAMPM(time) {
    var time = new Date(time * 1000);
    hour = time.getHours();
    min = time.getMinutes();
    if (hour > 12) {
        time = hour - 12 +':' + min + ' ' + 'PM';
    } else {
        time = hour +':' + min + ' ' + 'AM';
    }
    return time;
}

